Tudo tem prazo de validade. 
Ao termos pensamentos negativos, devemos também se lembrar daqueles que nos amam, não nos baseando no sofrimento alheio como maneira de minimizar o nosso ou disputar quem  sofre mais, porém existem pessoas que carregam em seu intimo cicatrizes que ainda sangram, mas diante da dor causada pelas mesmas, medicam-se com amor, bons pensamentos e fé de que tudo irá melhorar. 
Eu poderia ainda, relatar várias situações pelas quais eu mesma passei, e que imaginei não ter mais motivos para sorrir, mas ainda assim, minhas experiências de vida não servem para outras pessoas assim como talvez também já não sirva nem mesmo para mim, afinal já não sou a mulher que fui. 
O que já vivi e ainda vou viver, ninguém poderá viver por mim. 
Caso você esteja se sentindo perdido – não só no mês de prevenção ao suicídio – mas sempre, lembre-se de que não está sozinho e não precisa passar por nada disso só. Peça ajuda, para profissionais, para representantes de sua religião, para amigos próximos, para quem sentir que poderá lhe ajudar, mas não perca suas esperanças. 
Não perca a tua fé entre as sombras do mundo, afinal  vale a pena ver o sol nascer, pois cada dia é uma chance de recomeçar. Ainda que teus pés estiverem doloridos e cansados, siga adiante, vá mais longe do que imaginou que poderia ir, siga sua luz interior e quando achar que ela se apagou, olhe para dentro e lembre-se de tudo o que o levou até aquele ponto. 
Pode ser cansativo, mas se esforce por você e por todos aqueles que verdadeiramente te amam, tenha paciência e coragem para seguir em frente. Não se esqueça que “Tudo passa e tudo se renova na terra, mas o que vem do céu permanecerá (Chico Xavier).”
